Basic_Behaviour:ActionScript.script:
set self.currentTask.name = "Scaled Step One";
set self.currentTask.begin = currentDateTime();
set self.currentTask.end = NULL;
set self.currentTask.stateName = "Waiting for Scaled Step One";
set self.currentTask.isForCompensation = NULL;
set self.currentTask.hasCompensation = NULL;
self.onBegin();
setTransactionID(self.getTransactionID());
e2eProcessTracing:StateStart("SimpleWorkflow", self.getProcessID(), "Scaled Step One");

set self.currentTask.name = "Scaled Step Two";
set self.currentTask.begin = currentDateTime();
set self.currentTask.end = NULL;
set self.currentTask.stateName = "Waiting for Scaled Step Two";
set self.currentTask.isForCompensation = NULL;
set self.currentTask.hasCompensation = NULL;
self.onBegin();
setTransactionID(self.getTransactionID());
e2eProcessTracing:StateStart("SimpleWorkflow", self.getProcessID(), "Scaled Step Two");

setTransactionID(self.getTransactionID());
set self.currentTask.end = currentDateTime();
append self.currentTask.copy() to self.executedTasks;

setTransactionID(self.getTransactionID());
set self.currentTask.end = currentDateTime();
append self.currentTask.copy() to self.executedTasks;

setTransactionID(self.getTransactionID());
self.onEnd();
e2eProcessTracing:StateEnd("SimpleWorkflow", self.getProcessID(), self.currentTask.name);
self.finished();
e2eProcessTracing:End("SimpleWorkflow", self.getProcessID(), "Finished");
